          <br>
          <b>WHERE CLASSMATES CAN MEET AND PROPOSE PROJECT <span class="redden-slides">IDEAS</span>
          <br>
          AND GET DIRECT COLLABORATION AND HELP ('BACKING') FROM <span class="redden-slides">PEERS</span>
          <br>
