        <p>
          <div id="toughest-step">THE TOUGHEST STEP TO MAKE IS TO <b><span id="toughest-start">START</span></b></div>
          <br>
          You have this IDEA and everyone has an idea, but you also have to...
        </p>
        <div id="start-content-internal">
          <div><b>PUBLISH</b></div> <div class="the-idea">THE IDEA</div> <div>GET IT OUT OF YOUR HEAD</div>
          <div><b>MAKE</b></div> <div class="the-idea">THE IDEA</div> <div><b>ATTRACT OTHER PEOPLE</b> TO COLLABORATE WITH AND TO WORK ON IT</div>
          <div><b>DESIGN</b></div> <div class="the-idea">THE IDEA</div> <div>SKETCH IT / TALK ABOUT IT</div>
          <div><b>BUILD</b></div> <div class="the-idea">THE IDEA</div> <div>PROGRAM IT / MAKE IT INTO A PROTOTYPE</div>
        </div>
        <p>
          THESE ARE THE BIGGEST CHALLENGES TO
          <br>
          <b><span id="ideaintoreality" class="greennen">MAKE THE IDEA A REALITY!</span></b>
        </p>
